hey also have a private theatre where people can watch their favourite sitcoms or even do a movie marathon. \n\nTo top it all, this place also has a quirky menu filled with starters, wraps and some yummy milkshakes. \n\nHead to Glue Reloaded today to have a fun day filled with laughter and entertainment!','Yes','N/A',NULL,NULL,'1','','',28.5615,77.3608,'0','0','','1','0','1','0','2020-03-30 09:04:37','2020-03-30 09:04:37','1','0','0','0'),(16,'public',70,0,58,'merchant','ISkate','6th Ambience Mall, NH-8, Ambience Island, DLF Phase 3, Sector 24, Gurugram, Haryana 122001, India','','2020-08-01','2020-08-01','2019-12-18','10:00:00','22:00:00','http://www.iskate.co.in/#booknow',100,6,0,'skating,ice','','iSKATE is a first-of-its-kind live entertainment concept in India, Delhi-NCRÊs first natural, indoor ice-skating rink spread across 15,000 sq.ft. and is located inside one of the biggest malls in the region. \n\nApart from ice-skating, the rink is popular for its wide array of recreational services,including gourmet food, beverage and icecream counters, as well as state-of-the-art light and sound technology. \n\nIn the next five years, Bird Hospitality plans to launch similar rinks and cafes in 10 different locations across India.','Yes','N/A',NULL,NULL,'1','','',28.5033,77.0975,'0','1','2020-05-16T23:30:27.899Z','1','0','1','0','2020-03-30 09:16:29','2020-03-30 09:16:29','1','0','0','0'),(17,'public',77,0,58,'merchant','Funky Kingdom Powered By CN','Block R 7 First Floor shop no.105, M3M Urbana, Ramgarh Rd, Ramgarh, Sector 67, Gurugram, Haryana 122102, India','','2020-08-01','2020-08-01','2019-12-18','11:00:00','23:00:00','https://www.nearbuy.com/delhi-ncr/funky-kingdom-powered-by-cn-kirti-nagar-industrial-area',100,5,20,'kids,gaming,vr','','Looking to spend quality time with the family? \nDitch the ordinary spots and head out for a day of fun and excitement with a trip to Funky Kingdom Powered by CN! Set within the Pacific Mall in Jakhan , \n\nFunky Kingdom is an entertainment center that offers activities for people of all ages. With arcade games, bumper cars, 9D virtual reality movie experience, and much more, Funky Kingdom is sure to keep you entertained and happy. \n\nSo get your family and friends along and head to Funky Kingdom Powered by CN for a memorable experience.','Yes','N/A',NULL,NULL,'1','','',28.3897,77.0678,'0','1','2020-05-16T23:30:35.624Z','1','0','1','0','2020-03-30 09:17:12','2020-03-30 09:17:12','1','0','0','0'),(18,'public',70,0,58,'merchant','Mastiii Zone','Block B, Industrial Area, Sector Swarn Nagri, Greater Noida, Uttar Pradesh 201308, India','','2020-08-01','2020-08-01','2019-12-18','11:00:00','22:00:00','https://in.bookmyshow.com/activities/mastiii-zone-noida/ET00081897',100,5,0,'snow,ice,gaming,sports','','If you thought gaming is supposed to be a child\'s play, think again! Challenge yourself and test your game skills at Mastiii Zone, a chain of gaming centers that promotes active play in a safe, secured and conveniently accessed locations of the city. \n\nMastiii Zone is an indoor game zone featuring state-of-the-art equipment, offering nothing short of a paradise for all the gaming fans. Featuring indoor games for all age groups like bowling alley, 7D theater, XD shooting, video games, arcade games, kiddy rides, redemption games, skill games and much more, Mastiii Zone is the centre for fun and entertainment. \n\nTake a break from your hectic schedules and have a fun-filled day by heading to Mastiii Zone.','Yes','N/A',NULL,NULL,'1','','',28.4534,77.5259,'0','0','','1','0','1','0','2020-03-30 09:18:09','2020-03-30 09:18:09','1','0','0','0'),(19,'public',60,0,58,'merchant','Worlds Of Wonder','Sector-38 A, Entry from Gate No. 11 Adjacent, The Great India Place Mall, near, Maharaja Agrasen Marg, Sector 38, Noida, Uttar Pradesh 201301, India','','2020-08-01','2020-08-01','2019-12-18','11:00:00','20:00:00','https://www.worldsofwonder.in/',100,7,0,'outdoor,amusement park,water park','','Worlds of Wonder is a world-class destination with an Amusement Park designed to cater to the needs of all age groups. It\'s modern, clean, and green. \n\nSpread over 20 acres, Worlds of Wonder - Amusement park offers 20 world class attractions. The rides and the sprawling property is well-known amongst the city youth and kids. You can bring your family and friends to enjoy the thrill, entertainment and fun, the Parks offer. \n\nWorlds of Wonder is considered to have the cleanest and well maintained Parks in the country and is known for its kid friendly rides. Spread across 10 acres, Worlds of Wonder is designed by White Water West (Canada) and Arihant (India). \n\nAll activities in WOW are closely monitored by a team of highly trained lifeguards. Come here to have an unforgettably extravagant time with your family and friends, feel the monotony fade away as you enjoy the rides and slides that it offers.\n\n','Yes','N/A',NULL,NULL,'1','','',28.5631,77.3253,'0','0','','1','0','1','0','2020-03-30 09:36:52','2020-03-30 09:36:52','1','0','0','0'),(20,'public',60,0,58,'merchant','Curated Tour at Lodhi Art District','Block 20, Institutional Area, Lodi Colony, New Delhi, Delhi 110003, India','','2020-08-01','2020-08-01','2019-12-18','10:00:00','22:00:00','https://paytm.com/events/delhi/art/curated-tour-at-lodhi-art-district/197982',100,8,0,'','','Lodhi Art District is an ongoing project started in 2016 with the aim of enhancing the visual identity of the neighbourhood and create a contemporary urban art hub for the city of Delhi. An immersive walk for the visitors in the pleasant environment of the open-air art museum of Lodhi Colony. Through the tour, guided by a St+art team member, you will discover the murals created by renown Indian and International artists.\n\nMeeting point - Indian Habitat Centre, Gate 3\n\nABOUT THE TOUR\nThe curated tours are interactive walks that take the visitors through the vibrant public art district of the capital. \nThrough the tours, St+art engages the public and introduce them to a new format of experiencing contemporary art and the city itself. \nThese walks will provide an insight into the historical aspects of the location, the stories behind the project and each one of the murals. \nThe participants will become active witnesses of the cityscape’s enhancement and of the re-imagination of its public spaces.\n\nABOUT LODHI ART DISTRICT\nSince 2015 St+art India foundation is working in close collaboration with CPWD and Swachh Bharat mission to re-invigorate the Lodhi colony area of New Delhi. Acclaimed international and national street artists worked on the walls between Khanna market and Meherchand market to convert Lodhi colony into India’s first public art district. 54 murals have been created so far, transforming this centrally located area into a democratic open air museum. A tour leader by the St+art team will provide insights into the history of the colony, the project, the backgrounds and contexts of the works. The close by attractions are the Safdarjung Tomb, Lodhi Garden and Khan Market.','Yes','N/A',NULL,NULL,'1','','',28.5883,77.2252,'0','0','','1','1','1','0','2020-03-30 10:31:33','2020-03-30 10:31:33','1','0','0','0'),(21,'public',60,0,58,'merchant','X-Mass & New Year Trip at Chopta Tungnath with WanderOn','Pandav Nagar, Delhi, 110092, India','','2019-12-20','2019-12-23','2019-12-18','19:00:00','19:00:00','https://paytm.com/events/delhi/new-year-adventure/x-mass-new-year-trip-at-chopta-tungnath-with-wanderon/204919',10,84,0,'','','Chopta is the prettiest spot on the Ukhimath-Chamoli road that connects Kedarnath with Badrinath via a clearly more picturesque, somewhat shorter route. \nThis sleepy little place, 35km up from Ukimath, is really just a bend in a very narrow, thickly forested mountain road. \nIt\'s the quaintest place you are likely to see en route, along with the famed bugyals (meadows) of the state peeking through towering trees, framed by snowy mountains in the distance. \n\nChopta is the springboard for a 5km trek to Chandrashila Peak and Tungnath - one of the Panch Kedar (sacred Shiva temples) in Garhwal, including Kedarnath, Rudranath, Madmaheshwar and Kalpeshwar.\n\nDay 1: \nChopta Arrival &amp; AcclimatizationStart from Delhi by 9 pm.\nPit stop at Devprayag - Witness the beautiful Sangam of Bhagirathi &amp; Alaknanda.\nBreakfast stop at Srinagar.\nReach Chopta by noon &amp; check in to the camps.\nFreshen Up &amp; relax in the lap of nature.\nDIY - Baniyakund TrekDinner &amp; sleep overnight.\n\nDay 2: \nTrek to Tungnath &amp; ChandrashilaWake up early &amp; witness the beautiful sunrise.\nHave breakfast.\nStart your trek to Tungnath.Reach Tungnath &amp; pay your respect at the highest abode of Lord Shiva.\nEnjoy your packed lunch &amp; start your journey to most astonished Chandrashila peak (if weather permits)Come back to the campsite by evening, dinner &amp; sleep overnight.\n\nDay 3: \nDeoria Tal Trek | DepartureWake up early &amp; witness the beautiful sunrise.Have breakfast.\nHead to Sari Village(Starting point for Deoria Tal Trek)Start your trek to astonishing Deoria Tal.\nReach Deoria Tal &amp; enjoy the stunning view.\nTrek back to Sari village &amp; depart for Delhi.\nReach Delhi next morning by 07:00 AM (tentatively)\n\nInclusions \nEntire travel as per the itinerary by Tempo Traveler. \n6 meals will be provided throughout the trip. \n2 meals (day 1) + 3 meals (day 2) + 1 meal (day 3) \nAccommodation for 2 nights in camps at Chopta. \nEvening snacks. \nTeam captain throughout the trip. \nDriver charges, toll tax, parking etc.\n\nExclusions: \nAny other Food and Beverage charge that is not included in the package.\nAny permit or entry tickets to viewpoints.\nAnything not mentioned in the inclusions column.','Yes','N/A',NULL,NULL,'1','','',28.6186,77.2793,'0','0','','1','1','0','0','2019-12-17 14:10:37','2019-12-17 14:10:37','1','0','0','0'),(22,'public',60,0,58,'merchant','Kasol Manali- NewYear Trip with WanderOn','Airport Plaza, Upper Bagdogra, Near Bihar More, Uttar Bagdogra, Siliguri, West Bengal 734014, India','','2020-02-28','2020-02-28','2019-12-18','07:00:00','12:00:00','https://paytm.com/events/delhi/new-year-adventure/kasol-manali-newyear-trip-with-wanderon/204951https://paytm.com/events/delhi/new-year-adventure/kasol-manali-newyear-trip-with-wanderon/204951',10,129,0,'','','The Himalayas, fulfilling its promise, are a reservoir of the immense amount of \'Him\' in the forms of Ice, Fresh and Underground Water. \nAnd the seeping of this moisture originates several rivers, which flows through the land of Himachal, namely Sutlej, Beas, Ravi, Chenab, and the Yamuna. \n\nIt is also the reason for dozens of lakes that covered Himachal Pradesh.From the underground waters to the peak of mountains, Himalayas has blessed Himachal with great natural riches. \n\nIn between, the Passes, the Valleys, and the Hot Springs are also the gifts of Himalaya to Himachal.A land of splendid mountains, a pristine place which feeds and provides solace to the mind and soul, a pious land which is associated with the supernatural, an enigma of a place which attracts people from every nook and corner of the world- It\'s incredible.\n\nDay 1: \nKasol | Chalal | Cafe Hopping Depart from Delhi at 06:30 pm on Day 0. Reach Kasol by morning. Soak in the peace &amp; beauty of Parvati Valley. You can explore the Kasol market, and try different cuisines at the local Hippie Cafe\'s, or just relax by the gushing Parvati River. In the evening, go for a hike to Chalal village and capture some beautiful views of Parvati Valley. Chill at the cafe\'s in Kasol and return to the Hotel for an early night.\n\nDay 2: \nKheerganga Trek | Camping After breakfast, start the drive to the trek starting point at Barsheni. Trek for 12 km along the Parvati Valley, crossing numerous waterfalls and spotting some breathtaking views. Reach Kheerganga and relax at the bonfire at the campsite. Dinner and overnight at the camps.Note: In case the route to Kheerganga is closed due to snowfall, we\'ll be trekking up to Rudranag (Mid Way Point) and stay in camps at Rudranag itself.\n\nDay 3: \nDeparture for Manali Start trekking down to reach to Kasol. After lunch, start the scenic drive to Manali. Check in to the hotel, have dinner and rest.\n\nDay 4: \nManali Local Sightseeing Wake up and have breakfast at the hotel. Go for the local sightseeing of Manali. Places to Visit - Vashishth Temple, Jogni Falls, Hidamba Temple, Mall Road. Come back by evening, stroll through the streets of Old Manali and check out different Hippie Cafe\'s. Come back to hotel &amp; sleep overnight.\n\nDay 5: \nDeparture Wake up lazy morning and after having breakfast explore more of the local market of Manali for some final shopping. Head back to Delhi by evening with some amazing trip memories. \nReach Delhi next day morning.\n\nInclusions: \nEntire travel as per the itinerary. \nAccommodation for 4 nights - 1 night in a hotel at Kasol, 1 night in camps at Kheerganga, 2 nights in a hotel/hostel at Manali on triple/quad sharing basis. \nA total of 7 meals - 1 meal on Day 1 (Breakfast) + 2 meals on Day 2 (Breakfast + Dinner) +2 meals on Day 3 (Breakfast + Dinner) +1 meal on Day 4 (Breakfast) +1 meal on Day 5 (Breakfast). \nTeam Captain throughout the trip. \nGuided trek from Barsheni to Kheerganga. \nOld Manali Cafe Crawl. \nDriver night charge, toll tax, and parking charges. \n\nExclusions: \nAny other Food and Beverage charge that is not included in the package. \nTips to guide, helper, cook or, staff member or any monument/viewpoint entry fee. \nAny other expense not mentioned in the inclusion column.','Yes','N/A',NULL,NULL,'1','','',26.6986,88.3141,'0','0','2020-01-04T13:36:28.002Z','1','0','0','0','2020-02-16 16:09:21','2020-02-16 16:09:21','1','0','0','0'),(23,'public',71,0,58,'merchant','Auli - Skiing & Trek with WanderOn','Pandav Nagar, Delhi, 110092, India','Akshardham Metro Station, Delhi','2020-02-20','2020-02-20','2019-12-18','19:00:00','12:00:00','https://paytm.com/events/delhi/adventure/auli-skiing-trek-with-wanderon/204914',8,84,0,'','','Do you know that the mighty Garhwal Himalayas are hiding an international ski resort that is too surreal to believe? \n\nRising above the holy town of Joshimath, Auli is a gem of a place for all those who love snow and winter sports! Located at a distance of approx 500 km, a trip from Delhi to Auli can easily be covered over a weekend! \nWhile you might get to see snow laid fields in many other places, what makes Auli different is that it is a very prominent Ski Destination in India! \n\nOwing to this, the best time to visit Auli is between December to March. The distance between Joshimath to Auli is 14kms and one can reach there by road. However, what\'s more worthy is the gondola cable car ride that takes you above the beautiful alpine forests to a thick, snow-clad meadow of Auli Resort!\n\nDay 1: \nJoshimath Arrival &amp; Acclimatization Start from Delhi by 09:00 p.m. on Day 0. \nPit stop at Devprayag - Witness the beautiful Sangam of Bhagirathi &amp; Alaknanda. \nBreakfast stop at Srinagar. \nReach Joshimath by evening &amp; check in to the hotel. \nFreshen Up &amp; relax. \nBonfire, dinner &amp; sleep overnight.\n\nDay 2: \nAuli Skiing &amp; Gorson Bugyal Trek Wake up early &amp; witness the beautiful sunrise. \nHave breakfast. \nStart your journey to Auli. \nYou can either go by ropeway or road. \nEnjoy the panoramic ice covered view &amp; enjoy skiing. \nTrek to Gorson Bugyal. \nCome back to the hotel by evening, dinner &amp; sleep overnight.\n\nDay 3: \nDeparture Wake up lazy morning and after having breakfast explore more of the local market of Joshimath for some final shopping. \nHead back to Delhi by 03:00 PM with some amazing trip memories Reach Delhi next day morning by 07:00 AM(tentatively)\n\nInclusions \nEntire travel as per the itinerary. \nAccommodation for 2 nights in a hotel at Joshimath. \n4 meals - 1 meal on Day 1 + 2 meals on Day 2 