sting, exciting, challenging, educational and\nabove all, extremely fun game.\n\nHow do you escape? → Find clues, make logical connections, solve puzzles,\nactivate mechanisms and break codes. You are in the role of a world-class detective\nand under the pressure of time you must discover and at the same time write your\nown adventure.\n\nWhat do we propose? → Through originality, innovation and well-developed scenarios\n, we turn the game into a true experience - the Captive experience!','Yes','N/A',NULL,NULL,'1','','',44.452,26.1097,'0','0','','1','1','1','0','2020-03-27 13:21:34','2020-03-27 13:21:34','1','0','0','0'),(102,'public',77,0,58,'merchant','Vernescu House (Palace Casino)','Calea Victoriei 133, București, Romania','','2020-02-27','2020-02-27','2019-12-30','00:00:00','23:59:00','https://palacecasinobucharest.ro/',100,0,0,'','','The story of the House of Vernescu unfolds centuries ago, and like any beautiful story, it hides a rich past combined with a lot of passion. It was originally built in 1821 by the Wallachian Filip Lenş, son of a nobleman of French origin.\n\nThe Palace was constructed as a wedding gift to his bride, Lisaveta Balotescu-Carpinisanu. A year later, in 1822, the building succumbed to a devastating fire. From the ashes, the then owner rebuilt the structure, turning it into the most beguiling palace of its time in Romania.\n\nThe building was rebuilt in 1882, and in 1886, heirs of Filip Lenş sold the house to Gheorghe “Guna” Dimitrie Vernescu (1829-1900), an emanate lawyer and politician, and one of the founders of the Romanian Liberal Party. From this second owner, leaning towards art and beauty, the house would inherit his name Casa Vernescu.\n\nVernescu himself brought more glamour and elegance to the building. Thus, between 1887 and 1889, he hired the great architect Ion Mincu to restore the villa to become the most impressive Palace on Calea Victoriei. In 1890, the paintings by George Demetrescu Mirea would complete the marble harmony with golden decorations, which feature the ceilings and walls, the stained glass and the large mirrors.\n\nUntil the end of the Second World War, the Ministry of National Economy, the Ministry of Industry and Commerce and even the Romanian Government have been headquartered here. Until 1990, the house was home to some ministries, and in 1990 it became the headquarters of the Writers’ Union of Romania.\n\nIn 1993, the house underwent a vast process of restoration, and now this masterpiece of architecture houses the renowned Palace Casino Bucharest and Restaurant Casa Vernescu. Dignified and full of mystery, the Vernescu House resisted the attempts of the time, remaining on the Mogosoaia Bridge, today’s Calea Victoriei, a landmark of Bucharest’s life ever since, and continues to captivate locals and tourists alike.','Yes','N/A',NULL,NULL,'1','','',44.4479,26.0892,'0','0','','1','0','0','0','2020-02-16 15:50:25','2020-02-16 15:50:25','1','0','0','0'),(103,'public',67,0,58,'merchant','Clay Play Ceramics','Strada Nerva Traian 4, București 030167, Romania','','2020-08-01','2020-08-01','2019-12-30','11:00:00','20:00:00','https://clayplay.ro/',50,10,0,'','','Utility and decorative ceramics. Pottery and clay modeling workshops for children and adults.\n\nThe \"Clay Play\" pottery and pottery center is a special place, where art blends with tradition, where you can purchase traditional or modern ceramic objects and you can experience the processing, modeling and decoration of clay at the potter\'s wheel!\n\n\"Clay Play\" is the place where anyone can make a long and beautiful journey in the world of shapes, glazes, materials and textures specific to the potter, this ancient and noble craftsman.\n\nThe workshops and courses \"Clay Play\" mean a passion for art, for traditions, for ceramics, a passion for turning clay from an earthen bulge into a unique creation. ♥\n\nWe are waiting for you, from small to large, to cross our threshold, to make friends with clay and to model 