  `event_cashback` int(10) NOT NULL DEFAULT '10',
  `event_cashback_premium` int(10) NOT NULL DEFAULT '20',
  `food_cashback` int(10) NOT NULL DEFAULT '10',
  `food_cashback_premium` int(10) NOT NULL DEFAULT '10',
