INSERT INTO `static_content` VALUES (1,'Blixr is an app that connects you with other people and cool experiences around you. Users can enjoy curated experiences with their connections or create their own experience, invite others and make new friends. We want to help people move away from virtual likes and followers to making real life memories together.','Personal information submitted to Demos is only used to contact you regarding Demos activities. Information about visitors to the Demos website domain is automatically logged for the purposes of statistical analysis. Such information includes the IP address from which you visit, referral address, and other technical information such as browser type and operating system. Your email address is not automatically logged without your knowledge.','Blixr is an app that connects you with other people and cool experiences around you. Users can enjoy curated experiences with their connections or create their own experience, invite others and make new friends. We want to help people move away from virtual likes and followers to making real life memories together.','2019-05-02 15:26:23');
